import React from "react";
import Card from "./Card";
const IngData = [
  {
    title: "Card 1",
    link: "https://picsum.photos/300",
  },
  {
    title: "Card 2",
    link: "https://picsum.photos/300",
  },
  {
    title: "Card 3",
    link: "https://picsum.photos/300",
  },
  {
    title: "Card 4",
    link: "https://picsum.photos/300",
  },
];

function Cards() {
  return (
    <div className="card-container">
      {IngData.map((card, index) => (
        <Card
          key={index}
          title={card.title}
          link={card.link}
          alt={card.title}
        />
      ))}
    </div>
  );
}

export default Cards;
